import React from "react";
import { Navbar, Nav, NavbarBrand, NavItem, Container } from "react-bootstrap";
import "../Styles/header.css";

export class NavBar extends React.Component {
  render() {
    return (
      <div>
        <Navbar id="navtheme" style={{ padding: 0 }}>
          <Container>
            <NavbarBrand>
              <img
                src={require("../Images/logo.png")}
                alt="logo"
                height="53px"
                width="200px"
              />
            </NavbarBrand>
          </Container>
          <Nav inline className="d-flex flex-row-reverse">
            <Nav.Link href="/" id="navItem">
              Explore Restaurants
            </Nav.Link>
            <Nav.Link href="/" id="navItem">
              Explore Restaurants
            </Nav.Link>
          </Nav>
        </Navbar>
      </div>
    );
  }
}

export default NavBar;
